actualizar_tabla = null;
function guardar_registro(accion, content_type, data, id_modificar, form_id, mostrar_notificacion, usar_timeout, reload, redirigir) {
    var texto_boton = accion.charAt(0).toUpperCase() + accion.slice(1);
    $.ajax({
        dataType: 'json',
        type: "POST",
        ...content_type,
        url: $("#variables").attr("modulo") === "respaldo_restauracion" ? "ControladorBD" : "ControladorCRUD",
        data: data,
        beforeSend: function () {
            $(".ingreso").prop("disabled", true);
            $(".ingreso").html('Guardando... ' + "<div id='spinner_carga' class='spinner-border  text-success spinner-border-sm' role='status'>" +
                    "<span class='sr-only'>...</span>" +
                    '</div>');
        },
        error: function (request, status, error) {
            $(".ingreso").prop("disabled", false);

            $(".ingreso").html(texto_boton);
            $("#resultado_operacion").html("<div class='alert alert-danger' role='alert'>" +
                    "Ocurri un error durante la operacin, intente de nuevo" +
                    "</div>");
        }
    }).done(function (data) {
        $(".ingreso").prop("disabled", false);
        $(".ingreso").html(texto_boton);
        var tipo, mensaje, texto, accion;
        accion = !id_modificar ? "Registro" : "Actualizaci\u00f3n"
        if (data.resultado) {
            tipo = 'success'
            mensaje = accion + " Exitoso"
            accion = !id_modificar ? "ingres" : "actualiz"
            texto = 'Se ' + accion + ' el registro correctamente'
        } else {
            tipo = 'danger'
            mensaje = accion + " no pud completarse"
            texto = 'Ocurri\u00f3 un error durante la operaci\u00f3n'
        }
        if (!mostrar_notificacion) {
            var id = "resultado_operacion";
            if ($("#variables").attr("modulo") === "historial_paciente;recetas_paciente") {
                id += actual;
            }
            $("#" + id).html("<div class='alert alert-" + tipo + "' role='alert'>" +
                    texto +
                    "</div>");
            if ($("#variables").attr("modulo") === "respaldo_restauracion") {
                $("#descarga").show();
            }

            $(".modal").modal('hide');
            $("#" + form_id).trigger("reset");

        } else {
            Swal.fire({
                icon: tipo === "danger" ? "error" : tipo,
                title: mensaje,

            })
        }
        if ($("#variables").attr("modulo") === "informacion_personal") {
            location.reload();
        } else if (table) {
            if (usar_timeout) {
                clearTimeout(actualizar_tabla);
                actualizar_tabla = setTimeout(() => {

                    if ($("#variables").attr("modulo") === "historial_paciente;recetas_paciente" && actual === "recetas_paciente") {
                        $("#" + actual).DataTable().destroy();
                        load_datatable(actual, 1)
                    } else {
                        if ($("#variables").attr("modulo") === "historial_paciente;recetas_paciente") {
                            table = $("#" + actual).DataTable()
                        }
                        table.ajax.reload();
                    }
                }, 500)
            } else {

                if ($("#variables").attr("modulo") === "historial_paciente;recetas_paciente" && actual === "recetas_paciente") {
                    $("#" + actual).DataTable().destroy();
                    load_datatable(actual, 1)
                } else {
                    if ($("#variables").attr("modulo") === "historial_paciente;recetas_paciente") {
                        table = $("#" + actual).DataTable()
                    }
                    table.ajax.reload();
                }
            }

        } else if (reload) {
            location.reload();
        }
        if (redirigir && redirigir.url) {
            if (redirigir.url === 'Mis_Citas.jsp') {
                $("#formulario_citas").hide();
            }
            setTimeout(() => {
                window.location.href = redirigir.url;
            }, 3000)
        }

    });
}
function resetear_formulario(id) {
    var $inputs = $("#" + id + " :input");
    $inputs.each(function () {
        if ($(this).prop("type") !== "checkbox" && $(this).attr("type") !== "button" && $(this).attr("type") !== "submit") {
            $(this).prop("class", "form-control");
            $(this).prop("readonly", false);
        }
    });
    $("select[name='permiso'] option").each(function () {
        if ($(this).val() != '') {
            $(this).remove();
        }
    });
    $('#' + id).trigger("reset");
}
async function editar(contenedores, datos) {
    var contenedores_opciones_dinamicas = {"modulo": "permiso", "servicio": "medico"}
    $("#id").prop("readonly", true);
    $("#id_receta").prop("readonly", true);
    if ($("#variables").attr("modulo") === "permisos_rol") {
        $("#modulo").prop("disabled", true);
    }
    $("#id").prop("readonly", true);
    var validador = 0;
    var arreglo_contenedores = contenedores.split(";");
    var arreglo_valores = datos.split("&");
    for (i = 0; i < arreglo_contenedores.length; i++) {
        if (arreglo_contenedores[i].toLowerCase() in contenedores_opciones_dinamicas) {
            await cargar_opciones(arreglo_valores[i], contenedores_opciones_dinamicas[arreglo_contenedores[i].toLowerCase()]);
        } else if (arreglo_contenedores[i].toLowerCase() == "cantidad_fecha") {
            if (!isNaN(arreglo_valores[i])) {
                $("#" + arreglo_contenedores[i].toLowerCase()).prop("type", "number");
                $("#" + arreglo_contenedores[i].toLowerCase()).prop("class", "form-control");
            } else {
                $("#" + arreglo_contenedores[i].toLowerCase()).prop("type", "text");
                /* $("#" + arreglo_contenedores[i].toLowerCase()).prop("class", "form-control mydatepicker");
                 iniciar_datetimepicker();*/
            }
        } else if (arreglo_contenedores[i].toLowerCase() == "permisos") {
            const info = arreglo_valores[i].split(',');
            console.log(info)
            $('#select_modificar').val(info);
            $('#select_modificar').trigger('change');
        }
        try {
            if (arreglo_contenedores[i].toLowerCase() != "contrasenia") {
                $("#" + arreglo_contenedores[i].toLowerCase()).val(arreglo_valores[i]);
                if ($("#" + arreglo_contenedores[i].toLowerCase()).attr("type") == "number" && arreglo_valores[i].includes("Lps. ")) {
                    $("#" + arreglo_contenedores[i].toLowerCase()).val(arreglo_valores[i].replace("Lps. ", ''));
                }
                if ($("#" + arreglo_contenedores[i].toLowerCase()).attr("type") == "number" && arreglo_valores[i].includes("%")) {
                    $("#" + arreglo_contenedores[i].toLowerCase()).val(arreglo_valores[i].replace(" %", ''));
                }

                if (arreglo_contenedores[i].toLowerCase() == "id_rol" && arreglo_valores[i] == "9") {
                    cargar_nuevo_input("formulario_actualizar");
                }
                if (arreglo_contenedores[i].toLowerCase() === "fecha" || arreglo_contenedores[i].toLowerCase() === "fecha_limite") {
                    $("#" + arreglo_contenedores[i].toLowerCase() + "input").val(arreglo_valores[i]);
                }
            }

        } catch (ex) {
            console.error(ex);
        }
        /* if (arreglo_contenedores[i].toLowerCase() == "tipo" && arreglo_valores[i] == "Servicio") {
         validador = 1;
         }*/


    }
    /* if (validador > 0) {
     validar_tipo();
     }*/
}
