function realizar_eliminacion(id, extra, mostrar_notificacion) {
    $.ajax({
        type: "GET",
        url: "ControladorCRUD",
        data: {"modulo": $("#variables").attr("modulo") === "historial_paciente;recetas_paciente" ? actual : $("#variables").attr("modulo"), "accion": "eliminar", "id": id, ...extra},
        dataType: "json",
        encode: true,
    }).done(function (data) {
        var tipo, mensaje;
        if (data.resultado) {
            tipo = 'success'
            mensaje = "Eliminaci\u00f3n Exitosa"
        } else {
            tipo = 'danger'
            mensaje = "Eliminaci\u00f3n Fallida"
        }
        if (!mostrar_notificacion) {
            $("#resultado_operacion").html("<div class='alert alert-" + tipo + "' role='alert'>" +
                    mensaje +
                    "</div>");
        } else {
            Swal.fire({
                title: mensaje,
                icon: tipo,
                showCancelButton: false,
            })
        }
        if ($("#variables").attr("modulo") === "historial_paciente;recetas_paciente") {
            table = $("#" + actual).DataTable()
        }

        table.ajax.reload();
    });
}
