function cargar_opciones(id, receptor) {
    $.ajax({
        type: "GET",
        url: "ControladorCRUD",
        data: {"modulo": $("#opciones").attr("modulo"),
            "busqueda": id},
        dataType: "json",
        encode: true,
        async: false,
        beforeSend: function () {
            $("select[name='" + receptor + "']").attr("disabled", true)
            $("select[name='" + receptor + "'] #opcionvacia").html("Cargando...")
        },
        error: function (request, status, error) {
            $("select[name='" + receptor + "']").attr("disabled", false)
            $("select[name='" + receptor + "'] #opcionvacia").html("Escoja una Opcin")
        }
    }).done(function (data) {
        var {data} = data;
        $("select[name='" + receptor + "']").attr("disabled", false)
        $("select[name='" + receptor + "'] #opcionvacia").html("Escoja una Opcin")
        $("select[name='" + receptor + "'] option").each(function () {
            if ($(this).val() != '') {
                $(this).remove();
            }
        });
        data.map(info => {
            $("select[name='" + receptor + "']").append($('<option>', {
                value: info[0],
                text: info[1]
            }));
        })
    });
}
function cambiar_estado(id, estado, campo, tabla, id_usuario, title, table, redirigir) {
    var data = {"tabla": tabla, "accion": "actualizar", "id": id}
    data[campo] = estado;
    Swal.fire({
        title: title ? title : 'Seguro que desea cambiar el estado a ' + estado + '?',
        icon: "warning",
        showCancelButton: true,
        cancelButtonText: "Cancelar",
        confirmButtonText: 'S\u00ED, continuar',
    }).then((result) => {
        /* Read more about isConfirmed, isDenied below */
        if (result.isConfirmed) {
            if (id_usuario && tabla == "detalle_reservacion") {
                data['id_usuario'] = $("#variables").attr("id_usuario")
            }
            if (redirigir && redirigir.url) {
                window.location.href = redirigir.url;
            }
            if (tabla == "reservaciones" && estado == "Finalizada") {
                verificar_atencion_y_entrega_reservacion(id, data)
            } else {
                actualizar_estado(data, table)
            }
        }
    })
}
function actualizar_estado(data, custom_table) {
    $.ajax({
        type: "POST",
        url: "ControladorCRUD",
        data: data,
        dataType: "json",
        encode: true,
    }).done(function (data) {
        var tipo, mensaje;
        if (data.resultado) {
            tipo = 'success'
            mensaje = "Actualizacin Exitosa"
        } else {
            tipo = 'error'
            mensaje = "Actualizacin Fallida"
        }
        Swal.fire({
            icon: tipo,
            title: mensaje,
            timer: 2000
        }).then(() => {
            if (data.resultado) {
                if (table)
                {
                    table.ajax.reload();
                }
                if (custom_table) {
                    $('#' + custom_table).DataTable().ajax.reload();
                }
            }
        })
    });
}
function enmascarar_inputs() {
    if ($('input[name="telefono"]').length) {
        $("input[name='telefono']").inputmask("(504) 9999-9999")
    }
    if ($('input[name="identidad"]').length) {
        $("input[name='identidad']").inputmask("9999-9999-99999")
    }
    if ($('input[name="rango_inicial"]').length) {
        $('input[name="rango_inicial"]').keyup(function (e) {
            var info = $(this).inputmask('unmaskedvalue')
            var index = info.indexOf(e.key)
            if (($(this).inputmask('unmaskedvalue')).length < 9) {
                $("input[name='rango_final']").val(e.target.value);
            } else if (index < 9 && $(this).inputmask('unmaskedvalue').length < 9) {
                var saved_value = $("input[name='rango_inicial']").val().substring(10, 9)
                $("input[name='rango_final']").val(e.target.value.substring(0, 9) + saved_value);

            }
        });
        $("input[name='rango_inicial']").inputmask("999-999-99-999999999", {
            onKeyValidation: function (key, result) {
                console.log(key + " - " + result);
            }
        });

    }
    if ($('input[name="rango_final"]').length) {
        $("input[name='rango_final']").inputmask("999-999-99-999999999")
        $('input[name="rango_final"]').keyup(function (e) {
            var info = $(this).inputmask('unmaskedvalue')
            var index = info.indexOf(e.key)
            if (($(this).inputmask('unmaskedvalue')).length < 9) {
                $("input[name='rango_inicial']").val(e.target.value);
            } else if (index < 9 && $(this).inputmask('unmaskedvalue').length < 9) {
                var saved_value = $("input[name='rango_inicial']").val().substring(10, 9)
                $("input[name='rango_inicial']").val(e.target.value.substring(0, 9) + saved_value);
            }
        });
    }
    if ($('input[name="rtn"]').length) {
        $("input[name='rtn']").inputmask("9999-9999-999999")
    }
}
